	function index($msg=null,$font='red')
	{
		$data['error']      = rawurldecode($msg);  
		$data['font']       = $font;      
		$data['view'] 				= "login";
		return $this->template($data);
	}

	function register($msg=null)
	{
		$data['error']      = $msg;        
		$data['view'] 				= "register";
		return $this->template($data);
	}

	function registerAction(){
		$post = $this->input->post();

		if($_POST['cap']!=$_POST['capword']){
			   return $this->register('Kode captcha tidak sama');
		}else{

			$this->load->library('form_validation');


			foreach ($post as $field => $value) {
				//$this->form_validation->set_rules("".$field."", "".$field."", "required");	
				$this->session->set_flashdata($field, $value);
			}

			$this->form_validation->set_rules('password', 'Password', 'required|matches[password_confirm]');
			$this->form_validation->set_rules('password_confirm', 'Password Confirmation', 'required');
			$this->form_validation->set_rules('email','Email','required|valid_email|is_unique[member.email]');
			$this->form_validation->set_rules('username','Usernam','required|callback_username_check');

			
			if ($this->form_validation->run() == FALSE)
			{
				
				return $this->register(validation_errors()); 

			}else{

				unset($post['password_confirm']);
				unset($post['capword']);
				unset($post['cap']);
				$post['password'] = base64_encode($post['password']);
				$this->db->insert('member',$post);
				return $this->index('Anda telah berhasil registrasi. Silahkan masukan usernam dan password');
			}
		}	

	}

	public function username_check($username)
	{
		$this->db->where('username',$username);
		$get = $this->db->get('member')->result();
		if(count($get) > 0){
			return true;
		}
		return false;
	}

