	function logout(){
		$this->session->unset_userdata('lkpp_logged_user');
		$this->session->unset_userdata('lkpp_logged_name');
		$this->session->unset_userdata('lkpp_logged_role');

		echo "<script>alert('Anda telah berhasil keluar dari aplikasi Inaproc')</script>";
		sleep(3);
		redirect('home');
	}

	
	function reset($msg=null,$font='red')
	{
		$data['error']      = $msg; 
		$data['font'] =$font;       
		$data['view'] 				= "reset";
		return $this->template($data);
	}

	function resetsubmit(){
		if($_POST['submit']=="submit"){
			if($_POST['cap']!=$_POST['capword']){
			   return $this->reset('Kode captcha tidak sama');
			}else{

				$this->db->where('rkn_email',$_POST['email']);
				$login = $this->db->get('auth_login')->result();
	
				if(count($login) > 0){
					$newpass = random_string('alnum', 10);
					$data['pass'] = md5($newpass); 
					$this->db->where('rkn_email',$_POST['email']);
					$this->db->update('auth_login',$data);
					$url = base_url().'signin/resetpass/'.base64_encode($_POST['email']);
					$content = "Anda sudah mengajukan untuk mereset password.<br>Silahkan klik link berikut untuk merubah password anda <a href='".$url."'>".$url."</a>";


					$this->load->library('email');


					$config['charset'] = 'utf-8';
					$config['wordwrap'] = TRUE;
					$config['mailtype'] = 'html';
					$this->email->initialize($config);
					
					$this->email->from('inaproc', 'INAPROC');
					$this->email->to($_POST['email']); 
					$this->email->subject('Password Baru Inaproc');
					$this->email->message($content);	
					$this->email->send();
				//	echo $this->email->print_debugger();
					
					return $this->reset('Silahkan cek email anda untuk merubah password','green');
					
				}else{
					
					return $this->reset('email tidak terdaftar');
				}
			}
		}
	}

	function resetpass($token){

		$this->db->where('rkn_email',base64_decode($token));
		$data = $this->db->get('auth_login');

		if(count($data) > 0){
			$query = $data->row_array();
			return $this->changePassword('',$query['id']);
		}

		return $this->index("token anda expired");
	}

	function changePassword($msg='',$id,$font='red'){
		$data['error']      = $msg;        
		$data['id']         = $id;
		$data['view'] 		= "changepass";
		$data['font']       = $font; 
		return $this->template($data);
	}
	
	function changepasswordaction(){

		if($_POST['submit']=="submit"){
			if($_POST['cap']!=$_POST['capword']){
			   return $this->changePassword('Kode captcha tidak sama',$_POST['id']);
			}elseif($_POST['pass']!=$_POST['repass']){
				return $this->changePassword('password tidak sama',$_POST['id']);
			}else{

				$this->db->where('id',$_POST['id']);
				$login = $this->db->get('auth_login')->result();
	
				if(count($login) > 0){
					
					$this->db->where('id',$_POST['id']);
					$data['pass'] = md5($_POST['pass']);
					$this->db->update('auth_login',$data);
					return $this->index('Password anda sudah dirubah',$_POST['id'],'green');
					
				}else{
					
					return $this->changePassword('Perubahan password gagal',$_POST['id']);
				}
			}
		}
	}
	
